import { MyListElementContent } from "./MyListElementContent";
import { useSelector } from "react-redux";

export const MyListsElementBox = () => {
  const { myLists } = useSelector((state: any) => state.lists);
  return (
    <>
      {myLists.map((item: any, index: number) => (
        <MyListElementContent item={item} index={index} />
      ))}
    </>
  );
};
